import "./App.css";
import UserList from "./components/userList";
import UserDetail from "./components/UserDetail";
import CountApp from "./hook/useCustomHook";
import("dotenv").config();

const UserData = [
  {
    id: 1,
    name: "Mitesh",
    email: "mitesh@gmail.com",
    status: "active",
  },
  {
    id: 2,
    name: "Jack",
    email: "jack@gmail.com",
    status: "active",
  },
  {
    id: 3,
    name: "Ali",
    email: "Ali@gmail.com",
    status: "inactive",
  },
  {
    id: 4,
    name: "Neel",
    email: "neel@gmail.com",
    status: "inactive",
  },
  {
    id: 5,
    name: "Jonny",
    email: "Jonny@gmail.com",
    status: "active",
  },
];

const Users = UserDetail(UserList, UserData);

function App() {
  return (
    <div>
      <Users></Users>
      <CountApp></CountApp>
    </div>
  );
}

export default App;
